import React from "react";
import "./Card.css";
import { FcLike } from "react-icons/fc";

const Card = ({ data }) => {
  return (
    <div className="Card bg-slate-200 rounded-lg relative">
      <div>
        <img src={data.image.url} alt={data.title} className=" rounded-t-lg" />
        <div className="wishlistButton">
          <button>
            <FcLike fontSize="1.75rem" />
          </button>
        </div>
        <div>
          <p>{data.title}</p>
          <p>{data.description}</p>
        </div>
      </div>
    </div>
  );
};

export default Card;
